// reportsAlpineData returns the Alpine.js data object for the reports section.
func reportsAlpineData(inspectionID string, clientEmail string) string {
	return fmt.Sprintf(`{
		format: 'pdf',
		email: '%s',
		generating: false,
		message: '',
		success: false,
		generate() {
			this.generating = true;
			this.message = '';

			const formData = new FormData();
			formData.append('format', this.format);
			if (this.email) {
				formData.append('recipient_email', this.email);
			}

			fetch('/inspections/%s/reports', {
				method: 'POST',
				body: formData
			})
			.then(response => {
				if (response.ok) {
					this.success = true;
					if (this.email) {
						this.message = 'Report generation started! The ' + this.format.toUpperCase() + ' will be emailed to ' + this.email + ' when ready.';
					} else {
						this.message = 'Report generation started! It will appear below when ready.';
					}
					// Trigger htmx to refresh the reports list
					document.body.dispatchEvent(new CustomEvent('reportQueued'));
				} else {
					this.success = false;
					this.message = 'Failed to generate report. Please try again.';
				}
			})
			.catch(() => {
				this.success = false;
				this.message = 'Failed to generate report. Please check your connection.';
			})
			.finally(() => {
				this.generating = false;
			});
		}
	}`, clientEmail, inspectionID)
}

